import React, { Component } from "react";
import { Button, Grid } from "semantic-ui-react";

const City = props => {
  return (
    <Grid id="city">
      {props.currentCity ? (
        <h4>
          Question {props.cityIndex + 1} of 20: Where is{" "}
          {props.currentCity.name}?
        </h4>
      ) : null}
      {props.nextButton ? (
        <Button onClick={props.nextQuest}>Next Q</Button>
      ) : null}
    </Grid>
  );
};

export default City;
